					<h3 class="title">Risk Management and	<br/>Optimizing Opportunities</h3>
					<p>Atlas Mining adopts a risk management approach that ensures adequate mitigation measures without curtailing the Companyâ€™s ability to innovate and capitalize on opportunities.</p>

					<p>The Board of Directors of Atlas Mining has constituted the Board Risk Oversight Committee (BROC), composed of Independent Directors, responsible for the oversight of the Companyâ€™s risk management system: how the Company manages its existing risk sources and minimizes the likelihood of their occurrence.</p>

					<p>Together with Carmen Copperâ€™s Enterprise Risk Management Committee, the Company rolled out policies and implementing guidelines at all operational levels. Risk dashboards, standard risk assessments, remediation measures and identified high probability risks are monitored and reported monthly.</p>
